A pair of sisters living in N City, Saitama prefecture...

The older sister earned a large fortune while she was young. and now, She's a celeb neet who's sometimes afflicted by net addiction. Her name is &quot;Midorikawa Ranko,&quot; or commonly called as &quot;Ran.&quot;

The younger sister is living off her older sister's fortune, wishing to progress in the normal society. her name is &quot;Midorikawa Hikaru,&quot; commonly called as &quot;Pandora.&quot;

The gothic loli neet sisters are bringing you a somewhat harsh, moe comedy!
